textOriginal:
Comentarista: Lula foi "descondenado". 
Lula:
28 processos vencidos;
Juiz declarado suspeito e parcial;
580 dias preso ilegalmente;
Retirado do pleito 2018;
Proibido de acompanhar velórios de parentes;
Proibido de conceder entrevista;
Retornou com TUDO E TODOS em 2022.
Parabéns Lula. Maior liderança viva da humanidade atualmente. O único homem, em sua posição, que olha para os povos com visão humanitária. Parabéns aos que acreditam no correto.
